ube.com/embed/_TF0UV1BcVM","width":1280,"height":720},"title":{"simpleText":"The Road to Coachella"},"description":{"simpleText":"Since third grade, Rafael Lopez ’07, aka Alf Alpha, had a deep love for Volkswagen buses because they made people smile. Combine that love and aspiration for music, and you get a boombox on wheels. Beating the odds and losing his mom at the age of eighteen, Lopez knew he wanted to fulfill his moms dreams for him and go to UC Riverside. Making music was his spiritual and therapeutic outlet during this time while he attended school. His dream was to share the love his mom gave him to the world and channel that through music. As a past Coachella artist, Lopez was the perfect alumnus to show Coachella goers and future students that UC Riverside is a place where you can live your dreams and build your full potential at full volume.\n\nThe song, \"El Padrino\", featured in this video is from Alf Alpha's new album \"Global Beats: Volume One\". It's scheduled to be released on April 30, 2023. To learn more go to:  http://www.alfalpha.com/\n\nSubscribe to our YouTube Channel: @ucriverside\nFollow us on Facebook: https://www.facebook.com/UCRiverside\nFollow us on Twitter: https://twitter.com/UCRiverside\nFollow us on Instagram: https://www.instagram.com/ucriversideofficial\nFollow us on LinkedIn: https://www.linkedin.com/school/university-of-california-riverside/mycompany/\nFollow us on TikTok: https://www.tiktok.com/@ucriverside?"},"lengthSeconds":"148","ownerProfileUrl":"http://www.youtube.com/@ucriverside","externalChannelId":"UCtbPljMtN6Af-ga-9exl4CQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK
